import React from "react";

function HelpSection() {
  return (
    <div className="help-section">
      <h3>Need Help?</h3>
      <ul>
        <li>Write code in the editor and click <b>Run</b>.</li>
        <li>Use <b>input()</b> in your code; enter input in the Input box.</li>
        <li>Try code snippets for quick learning!</li>
        <li>Switch between Light/Dark mode for comfort.</li>
        <li>Share code with friends using the Share button.</li>
        <li>Errors will be shown in red below the output.</li>
      </ul>
    </div>
  );
}

export default HelpSection;
